import React from 'react';

const AboutUs = () => {
    return (
        <div className="bg-gray-900 text-white p-8">
            <h1 className="text-4xl font-bold mb-4">About Us</h1>
            <p className="mb-4">
                Welcome to our Doberman breeding business! We are passionate about breeding healthy, happy, and well-socialized Doberman puppies. Our mission is to provide families with loving companions that are not only beautiful but also possess the temperament and intelligence that Dobermans are known for.
            </p>
            <h2 className="text-2xl font-semibold mb-2">Our Experience</h2>
            <p className="mb-4">
                With over a decade of experience in breeding Dobermans, we adhere to the highest standards of breeding ethics. Our dogs are raised in a loving environment, ensuring they receive the best care and socialization from an early age.
            </p>
            <h2 className="text-2xl font-semibold mb-2">Breeding Ethics</h2>
            <p className="mb-4">
                We prioritize the health and well-being of our dogs above all else. Our breeding practices are designed to promote genetic diversity and minimize health issues. We conduct thorough health screenings and only breed dogs that meet our strict criteria.
            </p>
            <h2 className="text-2xl font-semibold mb-2">Our Mission</h2>
            <p>
                Our mission is to connect families with the perfect Doberman companion. We believe that every puppy deserves a loving home, and we are committed to supporting our buyers throughout the adoption process and beyond.
            </p>
        </div>
    );
};

export default AboutUs;
